import React from 'react';

function ResultGameModal() {
    return (
        <div class="modal-result-game">
            <div class="result-game-wrapper">
                <div class="result-game-header">
                    <img src="./assets/img/general/Game_design-7 [Converted]-11.png" alt="Game result" />
                    <button class="result-game-button-close"></button>
                    <h2 id="your-own-score">Your Own Score</h2>
                </div>
                <h1 class="final-score-text">0</h1>
                <div class="choices-group">
                    <button class="primary-button cancel-game-text">Cancel game</button>
                    <button class="primary-button restart-game-text">Restart game</button>
                </div>
                <div class="register-toggle-label">
                    <p>Register</p>
                </div>
            </div>
        </div>
    );
}
export default ResultGameModal;
